import React, { useState } from "react";
import { FaMapMarkedAlt, FaUsers, FaStar, FaGlobe, FaFacebook, FaInstagram } from "react-icons/fa";
import emailjs from "@emailjs/browser";
import { useTranslat } from "react"
const Aboutus = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [form, setForm] = useState({ name: "", email: "", message: "" });
  const phoneNumber = "403-604-9794"; // Your contact number
  const contactEmail = "info@example.com"; // Your contact email

  // Handle the change in input fields
  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm((prevForm) => ({
      ...prevForm,
      [name]: value,
    }));
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();

    const templateParams = {
      from_name: form.name, // Sender's name
      from_email: form.email, // Sender's email
      message: form.message, // Message content
    };

    emailjs
      .send(
        "service_g1dka7g",   // Replace with your EmailJS service ID
        "template_thwyahw",  // Replace with your EmailJS template ID
        templateParams,
        "8xsBRcAMM1CUEbrR4"    // Replace with your EmailJS public key
      )
      .then(
        (result) => {
          alert("Message sent successfully!");
          setForm({ name: "", email: "", message: "" }); // Clear form after submission
        },
        (error) => {
          alert("Failed to send message. Please try again.");
        }
      );
  };

  return (
    <div className="bg-gray-100">
      {/* Hero Section */}
      <div className="max-w-5xl mx-auto py-16 px-6 text-center">
        <h2 className="text-4xl font-bold text-gray-800">{t('Our Story')}</h2>
        <p className="mt-4 text-lg text-gray-600">
          With 18 years of experience in the travel industry, we proudly help thousands of travelers create unforgettable experiences across the globe. Our mission is to make every journey seamless, enjoyable, and truly life-changing.
        </p>
      </div>

      {/* Why Choose Us Section */}
      <div className="bg-white py-16 px-6">
        <div className="max-w-6xl mx-auto text-center">
          <h2 className="text-4xl font-bold text-gray-800">Why Choose Us?</h2>
          <div className="mt-10 grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-8">
            {/* Cards with icons */}
            <div className="flex flex-col items-center text-center p-6 bg-gray-50 shadow-md rounded-lg">
              <FaMapMarkedAlt className="text-blue-600 text-5xl mb-4" />
              <h3 className="text-xl font-semibold">Expert Guidance</h3>
              <p className="text-gray-600 mt-2">We provide curated travel experiences tailored to your preferences.</p>
            </div>
            <div className="flex flex-col items-center text-center p-6 bg-gray-50 shadow-md rounded-lg">
              <FaUsers className="text-blue-600 text-5xl mb-4" />
              <h3 className="text-xl font-semibold">Personalized Service</h3>
              <p className="text-gray-600 mt-2">We treat every traveler like family, ensuring your trip is stress-free.</p>
            </div>
            <div className="flex flex-col items-center text-center p-6 bg-gray-50 shadow-md rounded-lg">
              <FaStar className="text-blue-600 text-5xl mb-4" />
              <h3 className="text-xl font-semibold">Top-Rated Destinations</h3>
              <p className="text-gray-600 mt-2">We partner with the best hotels and tour operators worldwide.</p>
            </div>
            <div className="flex flex-col items-center text-center p-6 bg-gray-50 shadow-md rounded-lg">
              <FaGlobe className="text-blue-600 text-5xl mb-4" />
              <h3 className="text-xl font-semibold">Global Reach</h3>
              <p className="text-gray-600 mt-2">We help you explore destinations across every continent.</p>
            </div>
          </div>
        </div>
      </div>

      {/* Call to Action */}
      <div className="bg-blue-600 text-white py-16 px-6 flex flex-col lg:flex-row items-center justify-center w-full">
        <div className="text-center flex flex-col items-center lg:w-2/3">
          <h2 className="text-4xl font-bold">Ready to Start Your Next Adventure?</h2>
          <p className="mt-4 text-lg">Let us plan your dream vacation today.</p>
          <div className="flex justify-center space-x-4 mt-4">
            <a href="https://facebook.com" target="_blank" rel="noopener noreferrer">
              <FaFacebook className="text-3xl text-white" />
            </a>
            <a href="https://instagram.com" target="_blank" rel="noopener noreferrer">
              <FaInstagram className="text-3xl text-white" />
            </a>
          </div>
          {/* Contact Email */}
          <p className="mt-4 text-lg"> <a href={`mailto:${contactEmail}`} className="underline">{contactEmail}</a></p>
        </div>

        {/* Form Section */}
        <form
          onSubmit={handleSubmit}
          className="bg-white p-6 shadow-md rounded-lg w-full lg:w-1/3 mt-6 lg:mt-0"
          autoComplete="on"
        >
          <input
            type="text"
            name="name"
            placeholder="Your Name"
            value={form.name}
            onChange={handleChange}
            className="w-full p-3 border rounded mb-3 focus:outline-none focus:ring-2 focus:ring-blue-500 text-gray-800"
            required
            autoComplete="name"
          />
          <input
            type="email"
            name="email"
            placeholder="Your Email"
            value={form.email}
            onChange={handleChange}
            className="w-full p-3 border rounded mb-3 focus:outline-none focus:ring-2 focus:ring-blue-500 text-gray-800"
            required
            autoComplete="email"
          />
          <textarea
            name="message"
            placeholder="Your Message"
            value={form.message}
            onChange={handleChange}
            className="w-full p-3 border rounded mb-3 focus:outline-none focus:ring-2 focus:ring-blue-500 text-gray-800"
            required
            autoComplete="off"
          ></textarea>
          <button
            type="submit"
            className="w-full p-3 bg-blue-600 text-white rounded hover:bg-blue-700"
          >
            Send
          </button>
        </form>
      </div>
    </div>
  );
};
//allamn

export default Aboutus;
